import React from 'react';
import PropTypes from 'prop-types';

const MainPage = ({ loginType }) => {
    return (
        <div>Main Page</div>
    );
};

MainPage.propTypes = {
    loginType: PropTypes.string.isRequired,
};

export default MainPage;
